import React from "react";
import "./skills.css";

import Bars from "react-bars";

const Skills = () => {
  const data = {
    languageData: [
      { label: "C", value: 90 },
      { label: "Kotlin", value: 80 },
      { label: "Javascript", value: 80 },
      { label: "C#", value: 65 },
      { label: "C++", value: 60 },
      { label: "Python", value: 60 },
    ],
    technologyData: [
      { label: "React Native", value: 85 },
      { label: "Android", value: 80 },
      { label: "React JS", value: 70 },
      { label: "Game Development", value: 50 },
    ],
  };
  return (
    <div class="skills" id="skills">
      <h1>Skills</h1>
      <div style={{ flexDirection: "row", display:'flex' }}>
        <div style={{width: '50%'}}>
          <h2>Programming Languages</h2>
          <Bars data={data.languageData} makeUppercase={true} color="#67699b" />
        </div>
        <div style={{width: '50%'}}>
          <h2>Technologies</h2>
          <Bars data={data.technologyData} makeUppercase={true} />
        </div>
      </div>
    </div>
  );
};

export default Skills;
